DECLARE temp NUMBER;
BEGIN
	SELECT COUNT(*) INTO temp FROM user_tables WHERE table_name = 'PREFIX';
	IF temp > 0 THEN EXECUTE IMMEDIATE 'DROP TABLE PREFIX CASCADE CONSTRAINTS PURGE'; END IF;
END;
/

CREATE
    TABLE PREFIX
    (
        PREFIX VARCHAR2(4) NOT NULL,
        EFF_DT DATE,
        EXPIR_DT DATE,
        NAME VARCHAR2(56),
        UM_CODE_OBSOLETE_IND VARCHAR2(1),
        UM_UNIT_INTERNAL_CD NUMBER(5),
        CONSTRAINT PREFIX_PK PRIMARY KEY (PREFIX)
    )
/

DECLARE temp NUMBER;
BEGIN
	SELECT COUNT(*) INTO temp FROM user_tables WHERE table_name = 'UNIT';
	IF temp > 0 THEN EXECUTE IMMEDIATE 'DROP TABLE UNIT CASCADE CONSTRAINTS PURGE'; END IF;
END;
/

CREATE
    TABLE UNIT
    (
        UNIT_ID NUMBER NOT NULL,
        UM_UNIT_CD VARCHAR2(15),
        ORG_TYPE_CD CHAR(2),
        ORG_TYPE VARCHAR2(14),
        UM_UNIT_INTERNAL_CD NUMBER(5),
        UM_UNIT_TYPE_CD VARCHAR2(12),
        UM_UNIT_TYPE VARCHAR2(112),
        START_DT DATE,
        END_DT DATE,
        LONG_NM VARCHAR2(56),
        SHORT_NM VARCHAR2(30),
        CONSTRAINT UNIT_PK PRIMARY KEY (UNIT_ID)
    )
/


DECLARE temp NUMBER;
BEGIN
