        PARENT_UNIT_ID NUMBER,
        CHILD_UNIT_ID NUMBER,
        START_DT DATE,
        END_DT DATE,
        CONSTRAINT UNIT_REL_PK PRIMARY KEY (UNIT_REL_ID)
    )
/

